ss=\"c239 \"><span style=\"font-weight: 400;\">95 tín chỉ</span></td>\n</tr>\n</tbody>\n</table>',0,0,'/public/upload/Copy%20of%20PHCN%205.jpg',NULL,'/public/thumbs/Copy%20of%20PHCN%205.jpg','','','',NULL,NULL,NULL,9999,NULL,NULL,NULL,NULL,9999.00,'[]',NULL,NULL,NULL,'1','/public/upload/Group%201000005856%20(2).jpg','/public/upload/Group%201000005856%20(2)xs.jpg','1','/public/upload/53.jpg','/public/upload/25x.png','MÔ TẢ <span class=\"c528 \" >NGÀNH ĐIỀU DƯỠNG</span>','Ngành học tương lai AI không thể thay thế','/public/upload/52.png','/public/upload/51.png','<p></p><ul><li>\r\n\r\nĐiều dưỡng được công nhận là một nghề độc lập ở Việt Nam, có thể tự mở các dịch vụ tư vấn, chăm sóc sức khỏe cho người dân, thu nhập tốt.</li><li>Không bị trí tuệ nhân tạo (AI) thay thế.</li><li>Nghề ổn định và an toàn, ưu ái những điều dưỡng viên có tay nghề cao.</li><li>Không bao giờ thất nghiệp.&nbsp;</li><li>Đến năm 2030, Việt Nam cần 50 nghìn điều dưỡng viên.</li><li>Được Nhà nước hỗ trợ 70% học phí trong tất cả các kỳ học.\r\n\r\n</li></ul><p></p>','Đăng ký tư vấn','/public/upload/73.png','1','/public/upload/53-2.jpg','/public/upload/25x.png','THÔNG TIN VỀ<span class=\"c552 \" > NGÀNH HỌC</span>','/public/upload/53-1.png','<p>Chương trình đào tạo ngành<b>&nbsp;Điều Dưỡng</b> chú trọng phát triển kỹ năng đánh giá và xử lý tình trạng bệnh nhân, thực hiện kỹ thuật điều dưỡng chuyên nghiệp, áp dụng kiến thức dược lý và dinh dưỡng, tư vấn sức khỏe tâm lý, phòng chống dịch bệnh, quản lý hồ sơ bệnh án, và sử dụng công nghệ thông tin cùng ngoại ngữ trong môi trường y tế.</p>','/public/upload/17.png','Thời gian đào tạo: <b class=\"c563 \" >3 năm</b>','/public/upload/17.png','Chuẩn đầu ra','<p><b> Kiến thức và kĩ năng chuyên ngành:</b></p>\r\n							<ul>\r\n								<li>Nhận định và phân loại tình trạng bệnh nhân.</li>\r\n								<li>Đưa ra chẩn đoán và hướng xử trí điều dưỡng phù hợp.</li>\r\n								<li>Thực hiện cấp cứu và sơ cứu ban đầu.</li>\r\n							</ul>\r\n							<p><b>Kỹ năng mềm khác:</b></p>\r\n							<ul>\r\n								<li>Thành thạo kỹ thuật điều dưỡng cơ bản và chuyên ngành.</li>\r\n								<li>Hỗ trợ bác sĩ trong các thủ thuật y tế.</li>\r\n								<li>Quản lý trang thiết bị, vật tư y tế và hồ sơ bệnh án.</li><li>Giao tiếp và tư vấn sức khỏe hiệu quả với người bệnh.</li>\r\n								<li>Giáo dục sức khỏe và phòng chống dịch bệnh trong cộng đồng.</li>\r\n								<li>Áp dụng công nghệ thông tin và ngoại ngữ trong chăm sóc sức khỏe.</li>\r\n							</ul>','Đăng ký tư vấn','/public/upload/73.png','1','/public/upload/57.png','/public/upload/25x.png','TỰ HÀO<span class=\"c583 \" > KHÁM PHÁ CƠ HỘI</span>','Cơ hội nghề nghiệp','Trải nghiệm đa dạng','/public/upload/Copy%20of%20PHCN%201_1.jpg','Cơ hội nghề nghiệp','<ul>\r\n										<li>Điều dưỡng viên.</li>\r\n										<li>Điều dưỡng cộng đồng.</li>\r\n										<li>Điều dưỡng viên tại nước ngoài.</li>\r\n										<li>Điều dưỡng viên phát triển công việc tại nhà.</li>\r\n									</ul>','/public/upload/Copy%20of%20PHCN%204.jpg','Vị trí công việc','<ul>\r\n										<li>Thông tin 1</li>\r\n										<li>Thông tin 2</li>\r\n										<li>Thông tin 3</li>\r\n									</ul>','/public/upload/56.png','Doanh nghiệp tương lai','<ul>\r\n										<li>Bệnh viện lớn: Bệnh viện Bạch Mai, Đa Khoa Nông nghiệp, BV Thể thao Việt Nam,...</li><li>Doanh nghiệp lớn của CHLB Đức, Hàn Quốc, Nhật Bản, Đài Loan.</li></ul><ul>\r\n									</ul>','/public/upload/Copy%20of%20%C4%90i%E1%BB%81u%20d%C6%B0%E1%BB%A1ng%204.jpg','Trải nghiệm nghề nghiệp ','<ul>\r\n										<li>Tại Bệnh viện đa khoa Nông nghiệp, Trung tâm phục hồi chức năng Bệnh viện Bạch Mai.</li><li>Ngày hội sắc màu 2023.</li><li>Chăm sóc và tầm soát sức khỏe cộng đồng.</li></ul><ul>\r\n									</ul>','/public/upload/55.png','Vị trí công việc','<ul>\r\n										<li>Thông tin 1</li>\r\n										<li>Thông tin 2</li>\r\n										<li>Thông tin 3</li>\r\n									</ul>','/public/upload/437930950_394895216799236_8873929543144994176_n.jpg','Hoạt động ngoại khóa','<ul