Dược luôn là một ngành “hot” với mức thu nhập cao và ổn định nhất trong lĩnh vực y tế.</li><li>Có thể phát triển khả năng kinh doanh độc lập, mở tiệm thuốc cho thu nhập tốt.</li><li>Cơ hội nghề nghiệp rộng mở, không lo thất nghiệp.</li><li>Được Nhà nước hỗ trợ 70% học phí trong tất cả các kỳ học.</li></ul><p></p><p><b></b></p><b><p></p></b><b><p></p></b><p></p>','Đăng ký tư vấn tuyển sinh','/public/upload/73.png','1','/public/upload/53-2.jpg','/public/upload/25x.png','THÔNG TIN VỀ<span class=\"c552 \" > NGÀNH HỌC</span>','/public/upload/Illustration_5.png','<p>\r\n\r\n<b></b></p><p></p><p>Chương trình đào tạo ngành<b>&nbsp;Dược</b> cung cấp kiến thức sâu rộng từ vi sinh, giải phẫu sinh lý, đến dược động học, giúp sinh viên nắm vững cách sử dụng và quản lý thuốc hóa dược, vắc xin, và dược liệu cổ truyền.&nbsp;Sinh viên sẽ học cách phân tích và đánh giá chất lượng thuốc, thực phẩm chức năng, mỹ phẩm, và vật tư y tế, đồng thời áp dụng kiến thức quản lý kinh tế và marketing dược để thúc đẩy sự nghiệp trong ngành dược.</p><b><p>\r\n<b></b></p></b><p></p>','/public/upload/17.png','Thời gian đào tạo: <b class=\"c563 \" >3 năm</b>','/public/upload/17.png','Kĩ năng đạt được','<p><b></b></p>\r\n\r\n<p><b></b></p>\r\n\r\n<b><p> Kiến thức và kĩ năng chuyên ngành:</p><p></p></b><p></p><ul><li>Sản xuất và pha chế thuốc theo tiêu chuẩn GMP và giám sát quy trình sản xuất.</li><li>Kiểm nghiệm dược phẩm: Lấy mẫu và kiểm nghiệm thuốc, mỹ phẩm và thực phẩm chức năng.</li></ul><p></p><b><p></p><p>\r\n\r\nKỹ năng mềm khác:\r\n\r\n</p><p></p></b><p></p><ul><li>Chẩn đoán bệnh thông thường và tư vấn sử dụng thuốc an toàn, hiệu quả.</li><li>Quản lý dược phẩm: Xử lý và kiểm soát.</li><li>Liệu hóa chất và dụng cụ y tế.</li><li>Ứng dụng công nghệ thông tin trong chuyên môn dược.</li><li>Đọc và hiểu tài liệu hướng dẫn và ký hiệu thiết bị bằng ngoại ngữ.</li></ul><p></p><b><p></p></b><ul>\r\n							</ul>','Đăng ký tư vấn tuyển sinh','/public/upload/73.png','1','/public/upload/57.png','/public/upl