4 \">\n<tbody>\n<tr class=\"c225 \">\n<td class=\"c226 \"><span style=\"font-weight: 400;\">Trình độ</span></td>\n<td class=\"c227 \"><span style=\"font-weight: 400;\">Cao đẳng</span></td>\n</tr>\n<tr class=\"c228 \">\n<td class=\"c229 \"><span style=\"font-weight: 400;\">Hệ</span></td>\n<td class=\"c230 \"><span style=\"font-weight: 400;\">Chính quy</span></td>\n</tr>\n<tr class=\"c231 \">\n<td class=\"c232 \"><span style=\"font-weight: 400;\">Danh hiệu</span></td>\n<td class=\"c233 \"><span style=\"font-weight: 400;\">Cử nhân thực hành</span></td>\n</tr>\n<tr class=\"c234 \">\n<td class=\"c235 \"><span style=\"font-weight: 400;\">Thời gian đào tạo</span></td>\n<td class=\"c236 \"><span style=\"font-weight: 400;\">3 năm</span></td>\n</tr>\n<tr class=\"c237 \">\n<td class=\"c238 \"><span style=\"font-weight: 400;\">Khối lượng kiến thức</span></td>\n<td class=\"c239 \"><span style=\"font-weight: 400;\">102 tín chỉ</span></td>\n</tr>\n</tbody>\n</table>',0,0,'/public/upload/28.png',NULL,'/public/thumbs/28.png','','','',NULL,NULL,NULL,9999,NULL,NULL,NULL,NULL,9999.00,'[]',NULL,NULL,NULL,'1','/public/upload/Group%201000005856_3.jpg','/public/upload/Group%201000005856xss.jpg','1','/public/upload/53.jpg','/public/upload/25x.png','MÔ TẢ <span class=\"c528 \" >NGÀNH KỸ THUẬT PHỤC HỒI CHỨC NĂNG</span>','Cơ hội việc làm không giới hạn','/public/upload/52.png','/public/upload/unsplash_tNCH0sKSZbA_3.png','<p>\r\n\r\n\r\n\r\n<b></b></p><p></p><p></p><ul><li>Ngành nghề có tính độc lập cao, không phụ thuộc vào cơ sở y tế, có thể thực hiện các dịch vụ phục hồi chức năng tại nhà.</li><li>Thu nhập tốt, được các nhà tuyển dụng săn đón với mức lương cao, đãi ngộ hấp dẫn.</li><li>Cơ hội việc làm không giới hạn. Cả nước đang thiếu khoảng 10.000 kỹ thuật viên \r\n\r\nphục hồi chức năng.</li></ul><p></p><b><p></p></b><p></p>','Đăng ký tư vấn tuyển sinh','/public/upload/73.png','1','/public/upload/53-2.jpg','/public/upload/25x.png','THÔNG TIN VỀ<span class=\"c552 \" > NGÀNH HỌC</span>','/public/upload/Illustration_4.png','<p>\r\n\r\n<b></b></p><p></p><p>Chương trình đào tạo ngành&nbsp;<b>Kỹ thuật phục hồi chức năng</b>&nbsp;được thiết kế theo tiêu chuẩn quốc tế, nhưng vẫn bám sát với thực tiễn xu hướng phát triển của ngành Kỹ thuật phục hồi chức năng tại Việt Nam, giúp sinh viên vùng kiến thức, thuần thục kỹ năng nghề, đáp ứng yêu cầu công việc.</p><b><p></p></b><p></p>','/public/upload/17.png','Thời gian đào tạo: <b class=\"c563 \" >3 năm</b>','/public/upload/17.png','Kĩ năng đạt được','<p><b></b></p>\r\n\r\n<p><b></b><b>Kiến thức và kỹ năng\r\nchuyên ngành:</b></p><p></p><ul><li>Thành thạo sơ cấp cứu\r\nban đầu.</li><li>Xác định vị trí giải\r\nphẫu cơ - xương - thần kinh, áp dụng phương pháp châm cứu và chữa bệnh không\r\ndùng thuốc.</li><li>Lượng giá chức năng\r\nhệ vận động.</li><li>Thực hiện thao tác vận\r\nđộng trị liệu.</li></ul><p><b>Kỹ năng mềm của kỹ\r\nthuật viên:</b></p><p></p><ul><li>Vận hành an toàn và\r\nbảo quản tốt trang thiết bị.</li><li>Tổ chức và quản lý\r\nkhoa phòng vật lý trị liệu.</li></ul><p></p><p></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p><b>Kỹ năng mềm khác:</b></p>\r\n\r\n<p></p><ul><li>Sử dụng công nghệ\r\nthông tin.</li><li>Ngoại ngữ cơ bản và ứng\r\ndụng chuyên môn.</li></ul><p></p><ul>\r\n							</ul>','Đăng ký tư vấn tuyển sinh','/public/upload/73.png','1','/public/upload/57.png','/public/upload/25x.png','TỰ HÀO<span class=\"c583 \" > KHÁM PHÁ CƠ HỘI</span>','Cơ hội nghề nghiệp','Trải nghiệm đa dạng','/public/upload/Image_3.png','Cơ hội nghề nghiệp','<p><b></b></p><p></p><p></p><ul><li>Kỹ thuật viên \r\n\r\nphục hồi chức năng \r\n\r\n tại các cơ sở y tế.</li><li>Kỹ thuật viên \r\n\r\nphục hồi chức năng \r\n\r\n tại nhà.</li><li>Nhân viên Kỹ thuật, tư vấn chuyên môn.</li></ul><p></p>','/public/upload/55.png','Vị trí công việc','<ul>\r\n										<li>Thông tin 1</li>\r\n										<li>Thông tin 2</li>\r\n										<li>Thông tin 3</li>\r\n									</ul>','/public/upload/312.png','Doanh nghiệp tương lai