0;\">2,5 năm</span></td>\n</tr>\n<tr class=\"c237 \">\n<td class=\"c238 \"><span style=\"font-weight: 400;\">Khối lượng kiến thức</span></td>\n<td class=\"c239 \"><span style=\"font-weight: 400;\">100 tín chỉ</span></td>\n</tr>\n</tbody>\n</table>',0,0,'/public/upload/CSSD3%201.png',NULL,'/public/thumbs/CSSD3%201.png','','','',NULL,NULL,NULL,9999,NULL,NULL,NULL,NULL,9999.00,'[]',NULL,NULL,NULL,'1','/public/upload/Group%201000005874_1.jpg','/public/upload/Group%201000005874xs_1.jpg','1','/public/upload/53.jpg','/public/upload/25x.png','MÔ TẢ NGÀNH<span class=\"c528 \" > NGÔN NGỮ & VĂN HÓA HÀN QUỐC</span>','Chắp cánh sự nghiệp tại xứ sở Kim Chi','/public/upload/52.png','/public/upload/unsplash_tNCH0sKSZbA.png','<p>\r\n\r\n\r\n\r\n<b></b></p><p></p><p></p><ul><li>Cơ hội nghề nghiệp đa dạng. Hiện có hơn 4.000 doanh nghiệp Hàn Quốc đang hoạt động tại Việt Nam, như: Lotte, Samsung, Hyundai, LG…Nhu cầu về nhân lực biết tiếng Hàn tiếp tục tăng mạnh trong những năm tới.</li><li>Cơ hội du học/ học bổng/ việc làm/ định cư tại Hàn Quốc.</li><li>Thu nhập cao: Mức lương khởi điểm theo trình độ tiếng Hàn TOPIK cấp 4 tại Việt Nam là 800 – 1000 USD/tháng.</li><li>Tiếng Hàn Quốc dễ học. Tiếng Hàn trong top 10 ngôn ngữ sử dụng phổ biến nhất trên thế giới.</li></ul><p></p>','Đăng ký tư vấn tuyển sinh','/public/upload/73.png','1','/public/upload/53-2.jpg','/public/upload/25x.png','THÔNG TIN VỀ<span class=\"c552 \" > NGÀNH HỌC</span>','/public/upload/Copy%20of%20TH%203.jpg','<p>\r\n\r\n\r\n\r\n<b></b></p><p></p><p><b></b>Ngành<b> Ngôn ngữ và Văn hóa Hàn Quốc</b> trình độ cao đẳng đào tạo nhân lực thành thạo các kỹ năng: Nghe, nói, đọc, viết, phiên dịch, biên dịch tiếng Hàn gắn với các lĩnh vực chuyên môn nghề nghiệp, đáp ứng yêu cầu bậc 5 trong Khung trình độ quốc gia Việt Nam.</p>\r\n\r\n\r\n\r\n<p></p>','/public/upload/17.png','Thời gian đào tạo: <b class=\"c563 \" >3 năm</b>','/public/upload/17.png','Kĩ năng đạt được','<p><b></b><b>Kiến thức và kỹ năng chuyên ngành:</b></p><p></p><ul><li>Đọc, nghe, viết được các bài viết/ bài nói bằng\r\ntiếng Hàn chuẩn mực.</li><li>Vận dụng được các kỹ năng nghe, nói, đọc, viết,\r\nbiên dịch, phiên dịch tiếng Hàn vào việc giao tiếp thông dụng.</li><li>Đạt trình độ bậc 4 theo Khung năng lực ngoại ngữ\r\n6 bậc dùng cho Việt Nam.</li><li>Kiến thức cơ bản về văn hóa, xã hội, chính trị,\r\nlịch sử, con người Hàn Quốc.</li></ul><p></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p><b>Kỹ năng mềm khác:</b></p>\r\n\r\n<p></p><ul><li>Sử dụng công nghệ thông tin.</li><li>Ngoại ngữ cơ bản và ứng dụng chuyên môn.</li></ul><p></p><ul>\r\n							</ul>','Đăng ký tư vấn tuyển sinh','/public/upload/73.png','1','/public/upload/57.png','/public/upload/25x.png','TỰ HÀO<span class=\"c583 \" > KHÁM PHÁ CƠ HỘI</span>','Cơ hội nghề nghiệp','Trải nghiệm đa dạng','/public/upload/23_1.png','Cơ hội nghề nghiệp','<p></p><div><ul><li>Giáo viên giảng dạy\r\ntiếng Hàn.</li><li>Phiên dịch, biên dịch\r\nviên tiếng Hàn.</li><li>Nhân viên (trợ lý,\r\nthư ký, văn thư) tại các cơ quan đại diện.</li><li>Nhân viên, quản lý\r\nkhách sạn, nhà hàng.</li><li>Hướng dẫn viên du lịch.</li><li>Tiếp viên hàng\r\nkhông.</li><li>Làm chủ doanh nghiệp/\r\ntổ chức hợp tác với Hàn Quốc.</li></ul><b></b>\r\n\r\n<p></p></div>','/public/upload/55.png','Vị trí công việc','<ul>\r\n										<li>Thông tin 1</li>\r\n										<li>Thông tin 2</li>\r\n										<li>Thông tin 3</li>\r\n									</ul>','/public/upload/Copy%20of%20TH%209.jpg','Doanh nghiệp tương lai','<p></p><p></p><ul><li>Tập đoàn Samsung,\r\nLG, Display, SPI Global, BLD Vina, Panasonic,...</li><li>Văn phòng thương mại,\r\ncác tổ chức hữu nghị, tổ chức chính phủ và phi chính phủ của Hàn Quốc.</li><li>Hãng hàng không Hàn\r\nQuốc.</li><li>Trung tâm ngoại ngữ,\r\ndu học.</li></ul><p></p>','/public/upload/Copy%20of%20TH%202.jpg','Trải nghiệm nghề nghiệp ','<p>\r\n\r\n</p><li>Tại doanh nghiệp Hàn\r\nQuốc liên kết với Cao đẳng Hà Nội.</li><li>Ngày hội văn hóa Hàn\r\nQuốc.</li><p></p>','/public/upload/55.png','Vị trí công việc','<ul>\r\n										<li>Thông tin 1</li>\r\n										<li>Thông tin 2</li>\r\n										<li>Thông tin 3</li>\r\n									</ul>','/public/upload/437930950_394895216799236_8873929543144994176_n.jpg','Hoạt động ngoại khóa','<p>\r\n\r\n</p><li>Cuộc thi Got Talent 2023</li><li>Thể thao ngoài trời và phòng tập Gym</li><li>Đại nhạc hội</li><p></p>','Đăng ký tư vấn tuyển sinh','/public/upload/73.png','Tìm hiểu thêm về trường','/public/upload/73.png','1','/public/upload/59.png','/public/upload/58.png','/public/upload/64.png','/public/upload/60.png','Hình thức <span class=\"c645 \" >tuyển sinh</span>','Xét điểm học bạ THPT','<ul>\r\n									<li><p>Điểm học tập\r\nlớp 10, 11, 12 từ 5.0 trở lên</p>\r\n\r\n\r\n\r\n\r\n\r\n</li>\r\n								</ul>','/public/upload/61.png','Xét kết quả thi tốt nghiệp THPT 2024','<ul>\r\n									<li>Điểm thi THPT từ 5.0 trở lên</li>\r\n								</ul>','/public/upload/61.png','/public/upload/65.png','/public/upload/62.png','Đối tượng <span class=\"c645 \" >tuyển sinh</span>','/public/upload/63.png','Học sinh tốt nghiệp THPT hoặc tương đương','/public/upload/63.png','','/public/upload/63.png','','/public/upload/63.png','','/public/upload/63.png','','/public/upload/63.png','','Đăng ký tư vấn tuyển sinh','/public/upload/73.png','/public/upload/66.png','1','/public/upload/Group%201000005875.png','1','/public/upload/5.png','Khám phá <span class=\"c699 \" >ngành học khác</span>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'','','','','','','',4.50,1,'2020-02-08 17:00:00','2024-04-17 01:50:33',NULL),(40,'23','Ngôn ngữ & văn hóa <br>Trung Quốc','Trình độ\r\nCao đẳng\r\n\r\n\r\nHệ\r\nChính quy\r\n\r\n\r\nDanh hiệu\r\nCử nhân thực hành\r\n\r\n\r\nThời gian đào tạo 3 năm','<table class=\"c224 \">\n<tbody>\n<tr class=\"c225 \">\n<td class=\"c226 \"><span style=\"font-weight: 400;\">Trình độ</span></td>\n<td class=\"c227 \"><span style=\"font-weight: 400;\">Cao đẳng</span></td>\n</tr>\n<tr class=\"c228 \">\n<td class=\"c229 \"><span style=\"font-weight: 400;\">Hệ</span></td>\n<td class=\"c230 \"><span style=\"font-weight: 400;\">Chính quy</span></td>\n</tr>\n<tr class=\"c231 \">\n<td class=\"c232 \"><span style=\"font-weight: 400;\">Danh hiệu</span></td>\n<td class=\"c233 \"><span style=\"font-weight: 400;\">Cử nhân thực hành</span></td>\n</tr>\n<tr class=\"c234 \">\n<td class=\"c235 \"><span style=\"font-weight: 400;\">Thời gian đào tạo</span></td>\n<td class=\"c236 \"><span style=\"font-weight: 400;\">2,5 năm</span></td>\n</tr>\n<tr class=\"c237 \">\n<td class=\"c238 \"><span style=\"font-weight: 400;\">Khối lượng kiến thức</span></td>\n<td class=\"c239 \"><span style=\"font-weight: 400;\">101 tín chỉ</span></td>\n</tr>\n</tbody>\n</table>',0,0,'/public/upload/31.png',NULL,'/public/thumbs/31.png','','','',NULL,NULL,NULL,9999,NULL,NULL,NULL,NULL,9999.00,'[]',NULL,NULL,NULL,'1','/public/upload/Group%201000005875.jpg','/public/upload/Group%201000005875xs.jpg','1','/public/upload/53.jpg','/public/upload/25x.png','MÔ TẢ NGÀNH <span class=\"c528 \" >NGÔN NGỮ <br>& VĂN HÓA TRUNG QUỐC</span>','Bệ phóng thành công cho sự nghiệp tại xứ tỷ dân','/public/upload/52.png','/public/upload/12_1.png','<p>\r\n\r\n\r\n\r\n<b></b></p><p></p><p></p><ul><li>Cơ hội việc làm luôn rộng mở, bắt kịp xu thế mới.</li><li>Tăng khả năng cạnh tranh.</li><li>Tiếng Trung có tính ứng dụng cao.</li><li>Mở cánh cửa du học Trung Quốc, Đài Loan.</li></ul><p></p>','Đăng ký tư vấn tuyển sinh','/public/upload/73.png','1','/public/upload/53-2.jpg','/public/upload/25x.png','THÔNG TIN VỀ<span class=\"c552 \" > NGÀNH HỌC</span>','/public/upload/31.png','<p>\r\n\r\n\r\n\r\n<b></b>Ngành <b>Ngôn ngữ &amp; Văn hóa Trung Quốc</b> trình độ cao đẳng là ngành, nghề đào tạo nhân lực thành thạo các kỹ năng: Nghe, nói, đọc, viết phiên dịch, biên dịch gắn với các lĩnh vực chuyên môn nghề nghiệp, đáp ứng yêu cầu bậc 5 trong Khung trình độ quốc gia Việt Nam.<b></b>\r\n\r\n\r\n\r\n</p>','/public/upload/17.png','Thời gian đào tạo: <b class=\"c563 \" >3 năm</b>','/public/upload/17.png','Kĩ năng đạt được','<p></p><p><b>Kiến\r\nthức và kỹ năng chuyên ngành:</b></p>\r\n\r\n<p></p><ul><li>Những kiến thức cơ bản về ngôn ngữ Trung Quốc.</li><li>Nghe, nói, đọc viết thành thạo tiếng Trung.</li><li>Có kiến thức về văn hóa, đất nước, con người, xã hội, chính trị, lịch sử\r\nTrung Quốc.</li><li>Am hiểu văn hóa Việt Nam, Trung Quốc và các quốc gia nói tiếng Trung.</li></ul><p></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p><b>Kỹ\r\nnăng mềm khác:</b></p>\r\n\r\n<p></p><ul><li>Kỹ năng giao tiếp, giao tiếp liên văn hóa, thuyết trình.</li><li>Sử dụng công nghệ thông tin.</li><li>Ngoại ngữ cơ bản và ứng dụng chuyên môn.</li></ul><p></p><p></p><ul>\r\n							</ul>','Đăng ký tư vấn tuyển sinh','/public/upload/73.png','1','/public/upload/57.png','/public/upload/25x.png','TỰ HÀO<span class=\"c583 \" > KHÁM PHÁ CƠ HỘI</span>','Cơ hội nghề nghiệp','Trải nghiệm đa dạng','/public/upload/Image.png','Cơ hội nghề nghiệp','<p></p><p></p><ul><li>Nhân viên (trợ lý đối ngoại, trợ lý kinh doanh, lễ tân…)</li><li>Hướng dẫn viên du lịch.</li><li>Điều hành các công ty lữ hành.</li><li>Giáo viên tại các trường Tiểu học, THCS</li><li>Quản lý dự án quốc tế tại các công ty đa quốc gia.</li><li>Chuyên viên trong lĩnh vực xuất nhập khẩu, tiếp thị quốc tế…</li><li>Biên dịch, phiên dịch.</li><li>Nghiên cứu viên tại các viện nghiên cứu ngôn ngữ Trung Quốc.</li><li>Mở trung tâm dạy tiếng Trung Quốc.</li></ul><p></p>','/public/upload/55.png','Vị trí công việc','<ul>\r\n										<li>Thông tin 1</li>\r\n										<li>Thông tin 2</li>\r\n										<li>Thông tin 3</li>\r\n									</ul>','/public/upload/Image2.png','Doanh nghiệp tương lai','<p></p><p></p><ul><li>Cơ quan ngoại giao, thông tấn.</li><li>Công ty đa quốc gia.</li><li>Viện nghiên cứu ngôn ngữ.</li><li>Trung tâm tiếng Trung.</li></ul><p></p>','/public/upload/Copy%20of%20TH%206.jpg','Trải nghiệm nghề nghiệp ','<p>\r\n\r\n</p><p><b></b></p><p></p><ul><li>Chương trình trao đổi sinh viên.</li><li>Tại doanh nghiệp Trung Quốc liên kết với Cao đẳng Hà Nội.</li><li>Ngày hội văn hóa Trung Quốc.</li></ul><p></p>','/public/upload/55.png','Vị trí công việc','<ul>\r\n										<li>Thông tin 1</li>\r\n										<li>Thông tin 2</li>\r\n										<li>Thông tin 3</li>\r\n									</ul>','/public/upload/437930950_394895216799236_8873929543144994176_n.jpg','Hoạt động ngoại khóa','<p></p><p></p><ul><li><i>Cuộc thi Got Talent 2023.</i></li><li><i>Thể thao ngoài trời và phòng tập Gym.</i></li><li><i>Đại nhạc hội.</i></li></ul><p></p>','Đăng ký tư vấn tuyển sinh','/public/upload/73.png','Tìm hiểu thêm về trường','/public/upload/73.png','1','/public/upload/59.png','/public/upload/58.png','/public/upload/64.png','/public/upload/60.png','Hình thức <span class=\"c645 \" >tuyển sinh</span>','Xét điểm học bạ THPT','<p></p><ul><li>Điểm học tập lớp 10, 11, 12 từ 5.0 trở lên</li></ul>\r\n\r\n<b></b><p></p>','/public/upload/61.png','Xét kết quả thi tốt nghiệp THPT 2024','<p><b></b></p><p></p><p></p><ul><li>Điểm thi THPT từ 5.0 trở lên