 sẽ đào tạo các chuyên ngành: Chăm sóc và tạo kiểu tóc; Chăm sóc da; Chăm sóc móng, vẽ móng nghệ thuật; Trang điểm; Phun xăm thẩm mỹ; Chăm sóc sức khỏe bằng phương pháp massage, bấm huyệt.</p><b><p></p></b>\r\n\r\n\r\n\r\n<p></p>','/public/upload/17.png','Thời gian đào tạo: <b class=\"c563 \" >2.5 năm</b>','/public/upload/17.png','Kỹ năng đạt được','<p><b></b></p>\r\n\r\n<p></p><p><b>Kiến\r\nthức và kỹ năng chuyên ngành:</b></p>\r\n\r\n<p></p><ul><li>Kiến thức cơ bản về da, tóc, móng, thực hiện thành thạo quy trình, kỹ\r\nthuật.</li><li>Kiến thức về hóa học và công nghệ trong sản phẩm chăm sóc sắc đẹp.</li><li>Hiểu rõ cấu tạo, công dụng và sử dụng an toàn các loại trang thiết bị,\r\ndụng cụ, mỹ phẩm chủ yếu của các kỹ thuật trong cơ sở chăm sóc sắc đẹp.</li></ul><p></p>\r\n\r\n\r\n\r\n\r\n\r\n<p><b>Kỹ\r\nnăng mềm khác:</b></p>\r\n\r\n<p></p><ul><li>Kỹ năng giao tiếp trong kinh doanh và cung cấp các dịch vụ phù hợp.</li><li>Biết quản lý một doanh nghiệp nhỏ trong ngành chăm sóc sắc đẹp, quản lý\r\nnhân sự/ cơ sở vật chất/ tài chính/ tiếp thị và kinh doanh/ chất lượng dịch vụ.</li><li>Ngoại ngữ cơ bản và ứng dụng chuyên môn.</li></ul><p></p><ul>\r\n							</ul>','Đăng ký tư vấn tuyển sinh','/public/upload/73.png','1','/public/upload/57.png','/public/upload/25x.png','TỰ HÀO<span class=\"c583 \" > KHÁM PHÁ CƠ HỘI</span>','Cơ hội nghề nghiệp','Trải nghiệm đa dạng','/public/upload/Image_2.png','Cơ hội nghề nghiệp','<p></p><p></p><ul><li>Nhân viên làm đẹp tại các spa/ thẩm mỹ viện/ trung tâm y tế</li><li>Chuyên gia trang điểm tại các studio, kênh truyền hình…</li><li>Chuyên gia trang điểm độc quyền cho các nghệ sĩ.</li><li>Chuyên viên phát triển sản phẩm mỹ phẩm.</li><li>Cố vấn sắc đẹp cho các VIP.</li><li>Giảng viên tại các cơ sở đào tạo spa, thẩm mỹ.</li><li>Quản lý cơ sở spa/ thẩm mỹ viện.</li></ul><p></p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n<p></p>','/public/upload/55.png','Vị trí công việc','<ul>\r\n										<li>Thông tin 1</li>\r\n										<li>Thông tin 