load/17.png','Kĩ năng đạt được','<p><b>\r\n\r\n</b></p>\r\n\r\n<p><b></b></p>\r\n\r\n<b><p></p></b><p><b>Kiến thức và kỹ năng chuyên ngành:</b></p><p></p><ul><li>Kỹ năng nghề nghiệp về chế biến các món ăn tại các khách sạn, nhà hàng, đáp ứng các yêu cầu về chất lượng.</li><li>Nghiệp vụ nhà hàng; Nghiệp vụ chế biến bánh và món ăn tráng miệng; Các kiến thức bổ trợ nghề nghiệp như: Tổng quan du lịch và khách sạn, xây dựng thực đơn, văn hóa ẩm thực, sinh lý dinh dưỡng, thương phẩm và an toàn thực phẩm.</li><li>Quản lý kinh tế, quản lý nghiệp vụ chế biến món ăn cơ bản: Quản trị tác nghiệp, hạch toán định mức, giao tiếp trong kinh doanh, thống kê kinh doanh, quản lý chất lượng, pháp luật kinh tế, nguyên lý kế toán, nghiệp vụ thanh toán.</li></ul><p></p><p><b>Kỹ năng mềm khác:</b></p><p></p><ul><li>Công thức chế biến các món ăn phổ biến, sử dụng được các nguyên liệu chính, nguyên liệu phụ và nguyên liệu gia vị trong chế biến các món ăn cơ bản của Việt Nam, Á, Âu, sử dụng được các loại trang thiết bị, dụng cụ chủ yếu để chế biến món ăn.</li><li>Các quy trình nghiệp vụ cơ bản về chế biến món ăn theo đúng quy trình kỹ thuật.</li><li>Các tiêu chuẩn chất lượng dịch vụ ăn uống và cách thức đánh giá chất lượng.</li><li>Tư vấn và giáo dục sức khỏe.</li><li>Ngoại ngữ cơ bản và ứng dụng chuyên môn.</li></ul><p></p><p></p><b><p></p><p></p></b><b></b><ul>\r\n							</ul>','Đăng ký tư vấn tuyển sinh','/public/upload/73.png','1','/public/upload/57.png','/public/upload/25x.png','TỰ HÀO<span class=\"c583 \" > KHÁM PHÁ CƠ HỘI</span>','Cơ hội nghề nghiệp','Trải nghiệm đa dạng','/public/upload/Image_1.png','Cơ hội nghề nghiệp','<p></p>\r\n\r\n<ul><li>Nhân viên ẩm thực.<p></p></li><li><p>Chuyên viên sự kiện ẩm thực.</p></li><li><p>Đầu bếp chuyên nghiệp.</p></li><li><p>Quản trị nhà hàng.</p></li><li><p>Dễ dàng khởi nghiệp kinh doanh ẩm thực</p></li><li><p>Chuyên viên nghiên cứu phát triển ẩm thực</p></li><li><p>Giáo viên</p></li><li><p>Làm việc tại nước ngoài</p></li></ul><b><p></p></b><b><p></p></b><b><p></p></b>\r\n\r\n<p></p><p></p><p></p><p></p><p></p><p></p>','/public/upload/55.png','Vị trí công việc','<ul>\r\n										<li>Thông tin 1</li>\r\n										<li>Thông tin 2</li>\r\n										<li>Thông tin 3</li>\r\n									</ul>','/public/upload/435113529_394896276799130_3479966771965743705_n.jpg','Doanh nghiệp tương lai','<p>\r\n\r\n<b></b></p><ul><li><p><b></b>Tập đoàn GOLDEN GATE</p></li><li><p>Khách sạn, nhà hàng, resort,...</p></li><li><p>Trung tâm nghiên cứu ẩm thực.</p></li><li><p>Cơ sở đào tạo về Kỹ thuật chế biến món ăn.<b></b></p></li></ul><p></p>','/public/upload/Copy%20of%20CBMA%208.jpg','Trải nghiệm nghề nghiệp ','<p></p>\r\n\r\n<ul><li>Thực tập trong lòng doanh nghiệp ngay từ năm nhất.<p></p></li><li><p>Học song song với chuyên ngành ngôn ngữ.</p></li><li><p>Cuộc thi nấu ăn.</p></li></ul><b><p></p></b><b><p></p></b>\r\n\r\n<p></p><p></p><p></p><p></p><p></p><p></p>','/public/upload/55.png','Vị trí công việc','<ul>\r\n										<li>Thông tin 1</li>\r\n										<li>Thông tin 2</li>\r\n										<li>Thông tin 3</li>\r\n									</ul>','/public/upload/437930950_394895216799236_8873929543144994176_n.jpg','Hoạt động ngoại khóa','<ul><li><p>Cuộc thi Got Talent 2023.</p></li><li><p>Thể thao ngoài trời và phòng tập Gym.</p></li><li><p>Đại nhạc hội.</p></li></ul><b><p></p></b>\r\n\r\n<p></p><p></p><p></p><p></p><p></p>','Đăng ký tư vấn tuyển sinh','/public/upload/73.png','Tìm hiểu thêm về trường','/public/upload/73.png','1','/public/upload/59.png','/public/upload/58.png','/public/upload/64.png','/public/upload/60.png','Hình thức <span class=\"c645 \" >tuyển sinh</span>','Xét điểm học bạ THPT','<ul>\r\n									<li>Điểm học tập\r\nlớp 10, 11, 12 từ 5.0 trở lên</li></ul><ul>\r\n								</ul>','/public/upload/61.png','Xét kết quả thi tốt nghiệp THPT 2024','<ul>\r\n									<li>Điểm thi\r\nTHPT từ 5.0 trở lên</li></ul><ul>\r\n								</ul>','/public/upload/61.png','/public/upload/65.png','/public/upload/62.png','Đối tượng <span class=\"c645 \" >tuyển s